VALUES ('8003170060944', 'Tofu al naturale', 'med Cona& dedicata a chi, come te, seeglie co attenzione i prodotti che consuma, perché sa che ogni scelta pu aiutare a migliorare il proprio benessere e quello dell\'ambiente. I prodotti VERSO NATURA VEG sono ideali per chi segue un\'alimentazior vegetariana. Questo prodotto non contiene alcun ingrediente di origi animale ed è quindi adatto anche a chi segue una dieta vegana. É prodotto con materie prime da agricoltura biologica, che vieta l\'uso OGM e rispetta l\'ambiente in tutte le fasi del processo produttivo. Il Tofu al naturale VERSO NATURA VEG è so仟ce e versatile: puoi gustarlo tagliato a cubetti con un \'insalata di verdure, utilizzarlo come base per preparare le tue ricette vegetariane o vegane Il Tofu è un alimento millenario di origine asiatica, altamente proteico e a basso contenuto di sale. Viene ricavato dalla cagliatura del succo estratto dai semi di soia e dalla successiva pressatura in blocchi PREPARAZIONE ALIMENTARE A BASE DI SOIA DA AGRICOLTURA BIOLOGICA. SENZA GLUTINE. INGREDIENTI Acqua, soia\' 41 %, cloruro di magnesio &quot;da agricoltura biologica). VALORI NUTRIZIONAL DA CONSUMARE ENTRO: ve la data riportata sul lato della confezione. CONSERVAZIONE: conservar in frigorifero da 0&quot;C a +4Ce consumare entro 2 giorni dall\'apertura.Prodotto confezionato sottovuoto non forare la confezione. per 100g per porzione di prodotto ORGANISMO DI CONTR AUTORIZZATO DAL MIP IT BIO 014 AGRICOLTURA ITALIA OPERATORE CONTROL 12749 Valori medi Valore energetico 558k)/134kcal 697/kJ/167kcal di cui Acidi grassi saturi 13g Carboidrati di cui Zuccheri Fibre Proteine Sale 0,7g 07g 1 89 1439 0,04g 98g 1.69 09g 0,9g 23PRODOTTO PER CONAD S.C. 179 VIA MICHELINO, 59 BOLOGN 05g DA CONBIO S.R.L NELLO STABILIMENTO DI CORIANO(RN) FRAZ. DI CERASOLO AUSA, VIA RIGARDARA, 30 Contiene 2 porzioni da 125g', 'https://static.openfoodfacts.org/images/products/800/317/006/0944/front_en.4.400.jpg', '', '', '', '', '', '', '', '', '', '1');

